        // dbg(u, v);
        if (dep[u] < dep[v])
            swap(u, v);
        for (int step = log - 1; step >= 0; --step) {
            if (dep[pa[u][step]] >= dep[v]) {
                for (auto x : ppl[u][step])
                    pq.insert(x);
                u = pa[u][step];
            }
            ++cnt;
        }
        if (u != v) {
            for (int step = log - 1; step >= 0; --step) {
                if (pa[u][step] != pa[v][step]) {
                    for (auto x : ppl[u][step])
                        pq.insert(x);
                    for (auto x : ppl[v][step])
                        pq.insert(x);
                    u = pa[u][step], v = pa[v][step];
                }
                ++cnt;
            }
            for (auto x : ppl[u][0])
                pq.insert(x);
            for (auto x : ppl[v][0])
                pq.insert(x);
            u = pa[u][0];
        }

        for (auto x : cs[u])
            pq.insert(x);
        /*
        while (pq.data.size())
            ans.insert(pq.data.top()), pq.data.pop();
        */
        assert(cnt < 20 * 2);
        for (auto x : pq.data)
            if (x != INT_MAX)
                ans.insert(x);
        vector<int> ret;
        auto it = next(ans.begin());
        for (int i = 0; i < a && it != ans.end(); ++it, ++i)
            ret.push_back(*it);
        // dbg(ans, u);
        return ret;
    };
    for (int i = 0; i < q; ++i) {
        cin >> u >> v >> a;
        auto ans = lca(u, v, a);
        cout << ans.size();
        for (auto x : ans)
            cout << ' ' << x;
        cout << '\n';
    }
    return 0;
};

