					return false;
				}
			}
			return true;
		}
		return false;
	}
	
	private static void colocarPalabra(char[][] tablero, String palabra, int fila, int columna, boolean horizontal, boolean diagonal) {
		
		if (horizontal) {
			for (int i = 0; i < palabra.length(); i++) {
				tablero[fila][columna + i] = palabra.charAt(i);
			}
